import React from 'react'

export default function EmptyBoxError() {
  const [inputError, setInputError] = useState(false);

  return (
    <>
      {inputError && 
      <p style={
        { 
          color: '#FF7979',
          fontSize: '11px',
          textAlign: 'right'
        }}>
        Last Name cannot be empty
      </p>
      } 
    </>
  )
}
